function pageprocessorBigDealPage5(pagedef, $scope, $routeParams, $compile, $http, $rootScope, $sce, $window, $location) {
  var data1 = $compile($(pagedef.datatemplate))($scope);
  $("#appContent").append(data1);

  $.blockUI();
  var tanentId = "DEALM";
  var appId = "694";
  var featureId = "17786";
  var url = "https://kryptosda.kryptosmobile.com/kryptosds/api/queryTenantData/" + tanentId + "/" + appId + "/" + featureId + "?subFeature=BestDeals";
  var proxyMethod = "POST";
  var proxyData = {
    "subtypeOf": "-"
  };
  try {
    $http({
      method: proxyMethod,
      url: url,
      data: proxyData
    }).
    success(function(data, status, headers, config) {
      $.unblockUI();
      console.log(JSON.stringify(data));
      $scope.nameList = data;
    }).
    error(function(data, status, headers, config) {
      console.log(JSON.stringify(data));
      $.unblockUI();
    });

  } catch (e) {

  }
  $scope.checkValidity = function(name) {
    var currentDate = new Date();
    var startDate = new Date(name.couponStartDate);

    var endTime = name.couponEndDate.split("/");
    console.log("year" + endTime[2]);
    console.log("month" + endTime[0]);
    console.log("day" + endTime[1]);

    var endDate = new Date(endTime[2], parseInt(endTime[0]) - 1, endTime[1], 23, 59, 59, 0);

    console.log(startDate);
    console.log(currentDate);

    console.log(endDate);
    console.log("-------------------------------------------------------------------------------------------------");

    if (startDate <= currentDate && endDate >= currentDate)
      return true;
    else
      return false;

  }
  $scope.openCouponDescription = function(name) {
    $rootScope.selectedCoupon = name;
    $location.path("/app/BigDeal/BigDealPage6");

  }
}

function pageprocessorBigDealPage13(pagedef, $scope, $routeParams, $compile, $http, $rootScope, $sce, $window, $location) {
    var data1 = $compile($(pagedef.datatemplate))($scope);
    $("#appContent").append(data1);
    $scope.firstname = "";
    $scope.lastname = "";
    $scope.email = "";
    $scope.phone = "";
    $scope.addline = "";
    $scope.addline2 = "";
    $scope.city = "";
    $scope.state = "";
    $scope.country = "";
    $scope.pincode = "";
    var profileData = $.jStorage.get("userdetails");
    if (profileData) {
        $scope.userDetail = profileData;
        $scope.showForm = false;
        $scope.firstname = profileData.firstname;
        $scope.lastname = profileData.lastname;
        $scope.email = profileData.email;
        $scope.phone = profileData.phone;
        $scope.addline1 = profileData.addline1;
        $scope.addline2 = profileData.addline2;
        $scope.city = profileData.city;
        $scope.state = profileData.state;
        $scope.country = profileData.country;
        $scope.pincode = profileData.pincode;
    }
    else {
        $scope.showForm = true;
    }
    $scope.saveDetails = function () {
        console.log($scope.phone.toString().length);
        var regex = /^[a-zA-Z]*$/;
        var testMail = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
        console.log($scope.firstname + "\n" + $scope.lastname + "\n" + $scope.email + "\n" + $scope.phone + "\n" + $scope.addline2 + "\n" + $scope.city + "\n" + $scope.state + "\n" + $scope.country + "\n" + $scope.pincode);
        if ($scope.firstname.toString().length == 0 || $scope.lastname.toString().length == 0 || $scope.email.toString().length == 0 || String($scope.phone.toString()).length == 0 || $scope.addline2.toString().length == 0 || $scope.state.toString().length == 0 || $scope.city.toString().length == 0 || String($scope.pincode.toString()).length == 0) {
            if (window.device) {
                navigator.notification.alert("Please provide all details.", null, 'Incomplete Data', 'Ok');

            }
            else {
                alert("Please provide all details.");
            }
        } else if (!regex.test($scope.firstname)) {
            if (window.device) {
                navigator.notification.alert("Firstname should only contains alphabets.", null, 'In-correct Data', 'Ok');

            }
            else {
                alert("Firstname should only contains alphabets.");
            }


        } else if (!regex.test($scope.lastname)) {
            if (window.device) {
                navigator.notification.alert("Lastname should only contains alphabets.", null, 'In-correct Data', 'Ok');

            }
            else {
                alert("Lastname should only contains alphabets.");
            }


        } else if (!testMail.test($scope.email)) {
            if (window.device) {
                navigator.notification.alert("Incorrect Email format.", null, 'In-correct Data', 'Ok');

            }
            else {
                alert("Incorrect Email format.");
            }


        }
        else if ($scope.phone.toString().length != 10) {
            if (window.device) {
                navigator.notification.alert("Incorrect Phone Number Length.", null, 'In-correct Data', 'Ok');

            }
            else {
                alert("Incorrect Phone Number Length.");
            }


        }
        else {
            var profileData = {
                firstname: $scope.firstname,
                lastname: $scope.lastname,
                email: $scope.email,
                phone: $scope.phone,
                addline1: $scope.addline1,
                addline2: $scope.addline2,
                city: $scope.city,
                state: $scope.state,
                country: $scope.country,
                pincode: $scope.pincode,
                country: "US"
            };
            console.log(JSON.stringify(profileData));
            $.jStorage.set("userdetails", profileData);
            if ($scope.deliverytype.indexOf("Delivery") != -1) {
                $scope.userDetail = profileData;
                $scope.showForm = false;
                $scope.$apply();
            } else {
                $location.path("/app/BigDeal/BigDealPage14");
            }
        }

    };
    $scope.openForm = function () {
        $scope.showForm = true;
    };
    $scope.itemSelected = function () {
        $location.path("/app/BigDeal/BigDealPage14");
    };

    $scope.myFocus = function (evt) {
        console.log(evt.target);
        console.log($(evt.target).offset());
        console.log($($("textarea")[1]).offset());
        $(".app-content .scrollable-content").animate({
            scrollTop: $(".app-content .scrollable-content").scrollTop() + $(evt.target).offset().top - 80
        }, 200);
    };

}

function pageprocessorBigDealPage12(pagedef, $scope, $routeParams, $compile, $http, $rootScope, $sce, $window, $location) {
    var data1 = $compile($(pagedef.datatemplate))($scope);
    $("#appContent").append(data1);
    $rootScope.back = function () {
        $location.path("/app/BigDeal/BigDealPage11");

    };
    if ($rootScope.restSelect.deliveryAvailable.indexOf("Y") != -1) {
        $scope.isDelivery = true;
    } else {
        $scope.isDelivery = false;
    }

    $scope.deliverytype = "";
    $scope.selected = false;
    $scope.selectedType = "";
    $scope.itemSelected = function () {
        if ($scope.deliverytype.length != 0) {

            $rootScope.deliverytype = $scope.deliverytype;
            $rootScope.backFromSummary = false;
            console.log($rootScope.deliverytype);

            if ($scope.deliverytype.indexOf("Delivery") != -1) {
                $scope.selectedType = "Provide Your Detail";
                $location.path("/app/BigDeal/BigDealPage13");

            } else {
                var profileData = $.jStorage.get("userdetails");
                if (profileData) {
                    $location.path("/app/BigDeal/BigDealPage14");
                }
                else {
                    $location.path("/app/BigDeal/BigDealPage13");
                }
                $scope.selectedType = "Go To Order Summary ";
            }


        }

    };
    $scope.deliverySelected = function () {
