function pageprocessorBigDealPage14(pagedef, $scope, $routeParams, $compile, $http, $rootScope, $sce, $window, $location)    {
    var data1 = $compile($(pagedef.datatemplate))($scope);
    $("#appContent").append(data1);
    $scope.cartItems = $rootScope.cartItems;
    var salesTax = 0.0925;
    $scope.subtotal = 0.0;
    $scope.addDeliverycharge=false;
    $rootScope.back=function(){
        $location.path("/app/BigDeal/BigDealPage12");

    };

    for (i = 0; i < $scope.cartItems.length; i++) {
        $scope.subtotal = $scope.subtotal + parseFloat($scope.cartItems[i].itemAmount);
    }
    $scope.subtotal = $scope.subtotal.toFixed(2);
    $scope.discount = $rootScope.restSelect.discount;
    $scope.discountamount = (parseFloat(($scope.discount) * parseFloat($scope.subtotal)) / 100).toFixed(2);
    $scope.salescharge = (($scope.subtotal - $scope.discountamount) * salesTax).toFixed(2);
    if($rootScope.deliverytype.indexOf("Pick")!=-1){
        $rootScope.backFromSummary=true;
        $scope.payableamount = (parseFloat($scope.subtotal) - parseFloat($scope.discountamount) + parseFloat($scope.salescharge)).toFixed(2);

    }
    else {
        $scope.addDeliverycharge=true;
        $scope.deliveryChargeAmount=$rootScope.restSelect.deliveryCharges;
        $scope.payableamount = (parseFloat($scope.subtotal) - parseFloat($scope.discountamount) + parseFloat($scope.salescharge)+parseFloat($scope.deliveryChargeAmount)).toFixed(2);

    }

    if ($scope.payableamount < $rootScope.restSelect.minOrderAmt) {
        $scope.showPay = false;
    }
    else {
        $scope.showPay = true;

    }
    $scope.itemSelected=function(){
        $rootScope.payableamount=$scope.payableamount;
        $rootScope.subtotal= $scope.subtotal;
        $rootScope.discount= $scope.discount;
        $rootScope.discountamount= $scope.discountamount;
        $rootScope.salescharge= $scope.salescharge;
        $rootScope.deliveryChargeAmount=$scope.deliveryChargeAmount;
        $location.path("/app/BigDeal/BigDealPage15");


    }
}

