function pageprocessorMyDeals4(pagedef, $scope, $routeParams, $compile, $http, $rootScope, $sce, $window, $location) {
    var data1 = $compile($(pagedef.datatemplate))($scope);
    $("#appContent").append(data1);
    $scope.selectedTab = true;
    $scope.hideDialog = true;
    $scope.myDealNameList = [];
    /*
     var userdetails = {
     "firstname": "Damanpreet",
     "lastname": "Singh",
     "email": "daman.preetsingh@yahoo.co.in",
     "img": "http://graph.facebook.com/653794768002863/picture?type=large",
     "DN": "Damanpreet Singh",
     "phone": "9717419431",
     "user_id": "3737"
     };
     $.jStorage.set("userdetails", userdetails);
     */
    var profiledata = $.jStorage.get("userdetails");

    if (profiledata) {
        if ($scope.myDealNameList.length == 0) {
            $.blockUI({
                message: '<div id="floatingBarsG"><div class="blockG" id="rotateG_01"></div><div class="blockG" id="rotateG_02"></div><div class="blockG" id="rotateG_03"></div><div class="blockG" id="rotateG_04"></div><div class="blockG" id="rotateG_05"></div><div class="blockG" id="rotateG_06"></div><div class="blockG" id="rotateG_07"></div><div class="blockG" id="rotateG_08"></div></div><div></div>'
            });
            var today = new Date();
            var dd = today.getDate();
            var mm = today.getMonth() + 1; //January is 0, so always add + 1

            var yyyy = today.getFullYear();
            if (dd < 10) {
                dd = '0' + dd
            }
            if (mm < 10) {
                mm = '0' + mm
            }
            today = yyyy + '-' + mm + '-' + dd;

            var dealUrl = "https://dealmonk.in/upcoming_deal/";

            var dealData = {
                "date": today, "user_id": profiledata.user_id
            };

            $http({
                url: dealUrl,
                method: 'POST',
                data: dealData
            }).then(function (res) {
                if (res.data.nameList.length == 0) {
                    $scope.hideDialog = false;
                    $scope.dialogMessage = "You have not selected any deals today."
                }
                $scope.myDealNameList = res.data.nameList;
                $.unblockUI();
            }, function (err) {
                $scope.err = err;
                $.unblockUI();
            });
        }
    }
    else {
        if (window.device) {
            navigator.notification.alert("User not logged-in" + "\n" + "Please log in.");
        }
        else {
            alert("User not logged-in" + "\n" + "Please log in.");
        }

        $location.path("/app/BigDeal/BigDealPage16");
    }

    $scope.selectedTab = true;
    $scope.hideDialog = true;
    $scope.dineInClick = function () {
        if ($scope.myDealNameList.length == 0)
            $scope.hideDialog = true;
        $("#dineinTab").addClass('foodTabSelected').removeClass('foodTabUnSelected');
        $("#foodDeliveryTab").addClass('foodTabUnSelected').removeClass('foodTabSelected');
        $scope.selectedTab = true;

    };
    $scope.deliveryClick = function () {
        $scope.hideDialog = true;
        $("#foodDeliveryTab").addClass('foodTabSelected').removeClass('foodTabUnSelected');
        $("#dineinTab").addClass('foodTabUnSelected').removeClass('foodTabSelected');
        $scope.selectedTab = false;
    };

}

